import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom';
import axios from 'axios';

interface Post { 
    caption: string,
    content: string,
    creator: string,
    recipe: string
}
const PostPage = () => {
    const [post, setPost] = useState<Post | null>(null);
    const { postId } = useParams();

    useEffect(() => {
        const getPostData = async () => {
        try {
            const response = await axios.get(`localhost:3000/api/getPost/${postId}`)
            setPost(response.data)
        }
        catch (error) {
            console.log(error)
        }
    } 
        getPostData();}, [])
  return (
    <div>hello 
    {postId}    
    {post?.caption}
    {post?.content}
    {post?.creator}
    {post?.recipe}
    
    </div>
  )
}

export default PostPage
